import React, { Component } from "react";
import SimpleReactFooter from "simple-react-footer";

class Footer extends Component {
  state = {};
  render() {
    // const description =
    //   "According to wikipedia, the cat (Felis catus) is a domestic species of small carnivorous mammal. It is the only domesticated species in the family Felidae and is often referred to as the domestic cat to distinguish it from the wild members of the family. A cat can either be a house cat, a farm cat or a feral cat; the latter ranges freely and avoids human contact.";
    // const title = "Cats";
    const columns = [
      {
        description:
          "The centre for distant learning (CDEC), established at the ICT Centre, MNIT Jaipur, aims to impart quality education, in the easiest manner, with equitable access to learners across the nation.",
        resources: [
          {
            name: "About",
            link: "/about",
          },
          {
            name: "Careers",
            link: "/careers",
          },
          {
            name: "Contact",
            link: "/contact",
          },
          {
            name: "Admin",
            link: "/admin",
          },
        ],
      },
      {
        title: "Legal",
        resources: [
          {
            name: "Privacy",
            link: "/privacy",
          },
          {
            name: "Terms",
            link: "/terms",
          },
        ],
      },
      {
        title: "Visit",
        resources: [
          {
            name: "Locations",
            link: "/locations",
          },
          {
            name: "Culture",
            link: "/culture",
          },
        ],
      },
    ];
    return (
      <SimpleReactFooter
        description={description}
        title={title}
        columns={columns}
        linkedin="fluffy_cat_on_linkedin"
        facebook="fluffy_cat_on_fb"
        twitter="fluffy_cat_on_twitter"
        instagram="fluffy_cat_live"
        youtube="UCFt6TSF464J8K82xeA?"
        pinterest="fluffy_cats_collections"
        copyright="black"
        iconColor="black"
        backgroundColor="bisque"
        fontColor="black"
        copyrightColor="darkgrey"
      />
    );
  }
}

export default Footer;
